import logo from '../logo.svg';
import '../App.css';
import Footer from './Footer'
import NavBar from './NavBar'
import Header from './Header';
import HomePage from './HomePage';

function App() {
  return (
    <div className="App">
      <Header/>
      <NavBar/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <HomePage/>


      </header>
      <Footer/>
    </div>
  );
}

export default App;
